import React, { Component } from 'react';


class App extends Component {
  constructor(props) {
    super(props);
    this.state = { searchText: ''};
  }

  render() {
    const { searchText } = this.state;
    return (
      <div>
        <h2>Users</h2>
        <div className = 'searchBox'>
          <form>
            Search:
            <input type = 'text' name = 'search' />
          </form>
        </div>
      </div>
    );
  }
}

export default App;
